const Contact = () => {
  return (
    <section className="contact">
      <h2>Contact Me</h2>
      <p>Email: Rani@jkkn.ac.in</p>
      <p>LinkedIn: Rani.com@LinkedIn</p>
      {/* Add other contact details */}
    </section>
  );
};

export default Contact;
